import React, { Component } from 'react'

class Login extends Component {
  render() {
    return (
      <div>
        <h2>Login</h2>
        <input
          type="email"
          placeholder='email'
        />
        <input type="password" />
        <button type='button'>Entrar</button>
      </div>
    )
  }
}

export default Login;
